import React from "react";

function ContactCard() {
    return (
        <div className="contacts">
            <div className="contact-card">
                <img src="../Manuel.jpg" />
                <h3>Manuel Carretero</h3>
                <p>Phone: 2221888266</p>
                <p>Email: manuelalejandrosac@gmail.com</p>
            </div>
        </div>
    )
}

export default ContactCard;
